import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import Header from "../Header/header";
import './portfolio.css';
import kickCan from "../../assets/images/kick-the-can.jpg"


function Portfolio() {

  const projects = [
    {
      name: 'project one',
      link: "some data",
      img: 'https://images.unsplash.com/photo-1519567770579-c2fc5436bcf9?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2340&q=80'
    },
    {
      name: 'project two',
      link: "some data",
      img: 'https://images.unsplash.com/photo-1519567770579-c2fc5436bcf9?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2340&q=80'
    },
    {
      name: 'project three',
      link: "some data",
      img: 'https://images.unsplash.com/photo-1519567770579-c2fc5436bcf9?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2340&q=80'
    }
  ];


  return (
    <>
      {projects.map((project, i)=>  (
        <Card className="bg-dark text-white project-card">
          <Card.Img src={kickCan} alt="Card image" id="currentWorksIMG" />
          <Card.ImgOverlay>
            <Card.Title className="card-text">Current</Card.Title>
          </Card.ImgOverlay>
        </Card>
      ))}
    </>



  );
}

export default Portfolio;
